function CarouselNavigation () {
	return(
		<div className="flex items-center justify-between mt-8">
      <div className="flex gap-2">
        <button className="w-10 h-10 rounded bg-white shadow">&larr;</button>
        <button className="w-10 h-10 rounded bg-white shadow">&rarr;</button>
      </div>
      <button className="text-skyblue font-medium hover:underline">
        See all Airports
      </button>
    </div>







	);
}
export default CarouselNavigation;
